import {useCallback, useEffect, useState} from "react";
import axios from "axios";
import AppLayout from "../../components/AppLayout";
import {Header} from "../BoxOffice/styles";
import {RankingWrapper} from "./styles";
import {useRecoilState} from "recoil";
import {rankingState} from "../../states/rankingState";

const Ranking = () => {
  const [ranking, setRanking] = useRecoilState(rankingState);
  const [isLoading, setIsLoading] = useState(true);

  const fetchRanking = useCallback(async () => {
    setIsLoading(true);
    try {
      const { data } = await axios.get('/api/ranking');
      setRanking(data);
      setIsLoading(false);
    } catch (error) {
      let message = 'Unknown Error';
      if (error instanceof Error) message = error.message;
      console.log(message);
    }
  }, []);

  useEffect(() => {
    fetchRanking();
  }, []);

  console.log(ranking);

  return (
    <AppLayout>
      <Header>
        <span>
          예매 순위
        </span>
      </Header>
      <RankingWrapper>
        123
      </RankingWrapper>
    </AppLayout>
  );
};

export default Ranking;
